import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";
import "./App.css";

const App = () => {
  const [theme, setTheme] = useState("light"); // Default theme: light

  const toggleTheme = () => {
    setTheme((prevTheme) => (prevTheme === "light" ? "dark" : "light"));
    document.documentElement.style.setProperty(
      "--bg-color-light",
      theme === "light" ? "#121212" : "#ffffff"
    );
    document.documentElement.style.setProperty(
      "--text-color-light",
      theme === "light" ? "#ffffff" : "#333333"
    );
  };

  return (
    <Router>
      <div className={`App ${theme}`}>
        {/* Navbar */}
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top">
          <div className="container">
            <Link className="navbar-brand" to="/">
              MyApp
            </Link>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarNav"
              aria-controls="navbarNav"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav ms-auto">
                <li className="nav-item">
                  <Link className="nav-link" to="/">
                    Home
                  </Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link" to="/courses">
                    Courses
                  </Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link" to="/contact">
                    Contact
                  </Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link" to="/account">
                    Account
                  </Link>
                </li>
              </ul>
              {/* Theme Toggle Button */}
              <button
                onClick={toggleTheme}
                className={`theme-toggle-btn ${
                  theme === "light"
                    ? "theme-toggle-btn-light"
                    : "theme-toggle-btn-dark"
                }`}
              >
                {theme === "light" ? "Dark Mode" : "Light Mode"}
              </button>
            </div>
          </div>
        </nav>

        {/* Routes */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/courses" element={<Courses />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/account" element={<Account />} />
        </Routes>
      </div>
    </Router>
  );
};

// Home Component
const Home = () => (
  <div className="theme-container">
    <div className="container mt-5">
      <h1>Welcome to Our Course Recommendation</h1>
      <p>Explore and find the best courses available.</p>
    </div>
  </div>
);

// Courses Component
const Courses = () => (
  <div className="theme-container">
    <div className="container mt-5">
      <h1>Courses</h1>
      <p>Here are your recommended courses.</p>
    </div>
  </div>
);

// Contact Component
const Contact = () => (
  <div className="theme-container">
    <div className="container mt-5">
      <h1>Contact Us</h1>
      <p>Get in touch with us for any queries or support.</p>
    </div>
  </div>
);

// Account Component
const Account = () => (
  <div className="theme-container">
    <div className="container mt-5">
      <h1>My Account</h1>
      <p>Manage your account details and preferences.</p>
    </div>
  </div>
);

export default App;
